import React from 'react';

const NavBar = () => {
    return (
        <React.Fragment>
            <nav>
                <a href='/'>CurlyB</a>

                <ul>
                    <li><a href='/'>Home</a></li>
                    <li><a href='/'>Blogs</a></li>
                    <li><a href='/'>Login</a></li>
                    <li><a href='/'>Sigup</a></li>
                </ul>
            </nav>

        </React.Fragment>
    );
}

export default NavBar;
